sap.ui.define(["sap/ui/test/opaQunit","./pages/NotFound","./pages/Master"],function(e){"use strict";QUnit.module("Phone not found");e("Should see the not found page if the hash is something that matches no route",function(e,t,o){e.iStartMyApp({hash:"somethingThatDoesNotExist"});o.onTheNotFoundPage.iShouldSeeTheNotFoundPage().and.theNotFoundPageShouldSayResourceNotFound()});e("Should end up on the master list, if the back button is pressed",function(e,t,o){t.onTheNotFoundPage.iPressTheBackButton("NotFound");o.onTheMasterPage.iShouldSeeTheList();o.iTeardownMyApp()});e("Should see the not found detail page if an invalid object id has been called",function(e,t,o){e.iStartMyApp({hash:"/SalesOrderSet/SomeInvalidObjectId"});o.onTheNotFoundPage.iShouldSeeTheObjectNotFoundPage().and.theNotFoundPageShouldSayObjectNotFound()});e("Should end up on the master list, if the back button is pressed",function(e,t,o){t.onTheNotFoundPage.iPressTheBackButton("DetailObjectNotFound");o.onTheMasterPage.iShouldSeeTheList();o.iTeardownMyApp()});e("Should see the not found text for no search results",function(e,t,o){e.iStartMyApp();t.onTheMasterPage.iSearchForSomethingWithNoResults();o.onTheMasterPage.iShouldSeeTheNoDataTextForNoSearchResults();o.iTeardownMyApp()})});